import React, {useEffect, useState} from "react";
import "./App.css";
import WorkoutCard from "./WorkoutCard"


function WorkoutList ( { selectedPlayer, athletes } ) {

    const [workoutCardList, setWorkoutCardList] = useState ([])

    useEffect(() => {
        fetch("http://localhost:9292/workouts")
        .then((res) => res.json())
        .then((data) => setWorkoutCardList(data))
    }, [])


    const workoutsToDisplay = workoutCardList.map((workout) => <WorkoutCard key={workout.id} workout={workout} athletes={athletes} athlete={selectedPlayer}/>)

    return (
        <div id="workout_list">
            {workoutsToDisplay}
        </div>
    )
}

export default WorkoutList
